INSERT INTO `posts` (`id`, `title`, `category_id`, `slug`, `image`, `admin_id`, `published`, `view`, `content`, `meta_title`, `meta_description`, `valetAddress`, `language`, `allow_comments`, `publish_date`, `created_at`, `updated_at`) VALUES
(15, 'fghfghsf', 6, 'fghfghsf', '/uploads/ckeditor/sliders/WHD-BACK2.png', 1, 1, 53, NULL, NULL, NULL, NULL, 'fa', 'inherit', NULL, '2022-01-26 15:29:41', '2022-08-24 09:29:52'),
(16, 'ghjghjghj', 6, 'dddddddddd', '/uploads/ckeditor/sliders/WHD-BACK2.png', 1, 1, 174, '<p style=\"text-align:center\"><img alt=\"\" src=\"/uploads/ckeditor/sliders/WHD-BACK2.png\" style=\"height:532px; width:681px\" /></p>\r\n\r\n<p>مشهورترین متن ساختگی &quot;لورم ایپسوم &quot; است که گفته می شود از قرن 16 پدید آمده است. لورم ایپسوم در یک زبان شبه لاتین ساخته شده است که کم و بیش با لاتین &quot;مناسب&quot; مطابقت دارد. این شامل یک سری کلمات واقعی لاتین است. این متن ساختگی باستانی نیز قابل درک نیست ، اما از ریتم اکثر زبان های اروپایی به خط لاتین تقلید می کند.</p>\r\n\r\n<blockquote>\r\n<p>&quot; تعداد زیادی از معابر لورم اپیسون در دسترس است ، اما اکثر آنها به نوعی دچار تغییر شده اند, با شوخ طبعی تزریق شده ، یا کلمات تصادفی که حتی کمی باورپذیر به نظر نمی رسند. &quot;</p>\r\n</blockquote>\r\n\r\n<p>مزیت ریشه لاتین آن و بی معنی بودن نسبی لورم ایپسوم این است که متن توجه را به خود جلب نمی کند یا توجه بیننده را از طرح منحرف نمی کند..</p>', NULL, NULL, NULL, 'fa', 'inherit', NULL, '2022-01-26 15:31:38', '2022-09-01 20:31:40');
