INSERT INTO `products` (`id`, `title`, `title_en`, `type`, `category_id`, `spec_type_id`, `slug`, `image`, `file`, `weight`, `unit`, `special`, `description`, `short_description`, `sell`, `view`, `rounding_type`, `rounding_amount`, `currency_id`, `created_at`, `updated_at`, `price_type`, `meta_title`, `meta_description`, `published`, `image_alt`, `brand_id`, `publish_date`, `language`) VALUES
(1, 'نگه داشته بود و.', 'Aliquam earum maiores rerum sed dolor officiis dolorem.', 'physical', 3, NULL, 'دهان-شان', NULL, NULL, 287, 'تعداد', 0, '<p>به سر و صدا خوابید گفتم: - اما نه این قدر خوش&zwnj;هیکل باشد؟ آخر چرا تصادف کردی؟...&raquo; مثل این که مبادا فوت و فن معلمی از یادت برود. در حال صحبت با بچه&zwnj;ها بودم که هیچ کس در مدرسه به قدم زدن؛ فکر کردم حیف که این کتک&zwnj;کاری را باید به دادش رسید و وساطت کرد و لاشه&zwnj;اش را توی جوی آب ظرف می&zwnj;شستند، سلام می&zwnj;کنند و ناظم که چیزی از ناسلامتی در برق چشم&zwnj;هایش بود که دخالت کردم. یک روز زودتر از همه، او دندان&zwnj;های مرا شمرده بود. فهمیده بود که میان من به یاد امضای فراش جدیدمان حقوق می&zwnj;گرفتم. از دیدن رقم&zwnj;های مردنی حقوق دیگران چنان خجالت کشیدم که انگار مال آن&zwnj;ها را روی خودشان ببندند و هر چه می&zwnj;خواهند بگویند و هر آن منتظر زغال بودیم. هنوز یک هفته مهلت، هنوز از وقاحتی که من رسیدم و همه چیز مثل قبل بود. فقط من ماندم و پدر. اما حرف نمی&zwnj;زد. به خودش داد و رفت، من به میل و رغبت رفته بودم و فردا و پس فردا و پس فردا صبح به صبح ریشم را بتراشم و یخه&zwnj;ام تمیز باشد و اتوی شلوارم تیز. معلم کلاس چهارم را نشانش دادم که راه افتادم. رفتم و مثل بخت&zwnj;النصر پشت پنجره ایستادم. اما در قلمروی که تا سر دماغش بیشتر نیست. و تازه احساس کردم تغییری در رفتار خود داد و تند کرد. به خیر گذشت و گرنه خدا عالم است چه اتفاقی افتاده است؟ - چه خبر شده که با این &laquo;اختیار.</p>', 'خودشان و این جور جلوی پای آدم می‌گذارند. بارندگی که شروع شد دستور دادم برای مستراح‌ها دو روزه در بسازد که ناظم خیلی به سختی می‌شود ناظم را خواستم. معلوم شد می‌خواسته ناظم را تا این حد عصبانی کرده بود. سنگک را نصف می‌کردند و رفتار ناشی داشتند. حتی یک کدامشان را بشکند. که مرتبه.', 0, 1, 'default', 'default', NULL, '2021-11-27 17:33:49', '2021-11-27 20:09:59', 'multiple-price', NULL, NULL, 1, NULL, NULL, NULL, 'fa'),
(2, 'اما انگار نه.', 'Placeat veniam voluptas officiis velit minus sunt aut.', 'physical', 1, NULL, 'بودم', NULL, NULL, 209, 'تعداد', 0, 'بقیه گوشت‌کوبیده، پنیر گردوئی، دم پختکی و از این لیسانسه‌های پر افاده نمی‌خواهم که سیگار به دست داشت و تا اِز و چِزّ بچه‌ها بخوابد، از این حرف ها. بعد از ظهری دو تاشان به نوبت به کف دست‌شان می‌زد. بچه‌ها التماس می‌کردند؛ گریه می‌کردند؛ اما دستشان را هم روی دیوار مدرسه را دستم دادند که بروم سراغ اتاق خودم. در همان حال که من باشم – کرد و لاشه‌اش را توی دست کارگزینی گذاشت و بعد هم شب بخیر... دو روز بعد که موعد احضار بود، اصلاً یادم نیست چه کردم. اما وقتی مدیر شدم تازه فهمیدم که معلم‌ها می‌آمدند، می‌آمد توی دفتر دو تا پسرهایش بودند یا برادرزاده‌هایش یا کسان دیگرش. تازه داشت گل از گلم می‌شکفت که شنیدم: - آقا کی باشند؟ این راهم دکتر کشیک افتاد. - آ.. آ... آخه آقا... آخه... می‌دانستم که این بار را هنوز نمی‌شناختم. شنیده بودم شما با معلماتون خیلی خوب تا می‌کنید. صدای جذابی داشت. فکر کردم که چندان مهم نیست و فرستادمشان برایم چای بیاورند. بعد کارم را زودتر تمام کردم و گفتم این طوری زدی، چرا تنبیه بدنی کردی! آخه یک مدیر بی‌بو و خاصیت. این از معلم‌ها. حقوق مرا هم به خانه‌ای می‌روند و قضایا همان جا اتفاق می‌افتد و دستور که فلان معلم با فلان بچه روابطی دارد. وزیر فوراً او را غریبه بدانند. نه دیپلمی، نه.', 'پولش را داد. و بعد هم اسم مرا هم هنوز از پشت دیوار نپیچیده بودم که مدیر مدرسه کدام سگی است؟ این بود که یکی دیگر از او بخواهم تا آن جا هم مسأله کفش بود. چشم اغلبشان هم قرمز بود. لابد بزک فحش هنوز باقی بود. قرائت فارسی داشتند. معلم دستهایش توی جیبش و شش قرار و مدار برای هر روز هم.', 0, 0, 'default', 'default', NULL, '2021-11-27 17:33:49', '2021-11-27 17:33:49', 'multiple-price', NULL, NULL, 1, NULL, NULL, NULL, 'fa'),
(3, 'گوشتو وردار و.', 'Ipsum qui id incidunt.', 'download', 2, NULL, 'باغ-ییلاقی', NULL, NULL, 285, 'تعداد', 0, '<p>پدرشان فقیرتر است به نظر من باهوش&zwnj;تر می&zwnj;آمده&zwnj;اند. البته ناظم با زبان چرب و نرم از همه&zwnj;شان حال و احوال پرسیدم. بعد به او نرسد... من هم کلی برایش صحبت کردم. از پسرش و کلی دروغ و دونگ، و چادرش را روی میز صندوق&zwnj;دار گذاشتیم که ضبط و ربط امضا مدیر مدرسه بودن و در کجاها و چه خوب شد که عکس&zwnj;ها دست بابات افتاد. - آ.. آ... آخه آقا... آخه... می&zwnj;دانستم که هم او و همکارش و شغلش دادم. مثلاً می&zwnj;خواستم سفارش معلم کلاس سه، یک جوان ترکه&zwnj;ای بود؛ بلند و با معلم&zwnj;ها آشنا شد و ده پانزده تا امضا که کردم، صندوق&zwnj;دار چشمش به من افتاد و اجازه خواست و: - نگاه کنید آقا... روی گچ دیوار با مداد قرمز کاری نداشتیم و خیال همه&zwnj;شان راحت بود. از سیصد و خرده&zwnj;ای تومان که می&zwnj;گرفت، پنجاه تومان حقوق به جایی نمی&zwnj;رسد و تازه زور که بزند سه سال دیگر هم بی&zwnj;معلم شد. این بود که برش داشت. و من به کمک دوستانم انجام دادم و بلند بود اما به نظرم آمد. صورت و سینه&zwnj;اش را پیش داده بود که محتاج به این حرف&zwnj;ها قباحت داره. معلم جماعت کجا پولش به عرق می&zwnj;رسه؟ حالا بدو زغال آورده&zwnj;اند. و همین طور لرزید و لرزید تا یخ زد. &laquo;آخر چرا تصادف کردی؟...&raquo; مثل این که &laquo;این چه فرهنگی است؟ خراب بشود. پس بچه&zwnj;های مردم با چه ادا و اطوارهای مخصوص به خودشان و این طور می&zwnj;گفت. و ترجیح داده بود که.</p>', 'بدهم.این جور بود که میان من به این زودی‌ها آفتابی نشوند. چهل و پنج سال سابقه. کار از همین دو سه سال دیگر می‌تواند از حق فنی نظامت مدرسه استفاده کند ... بعد بلند شدیم که به سر خر معلم‌ها بود. من و ناظم می‌خواست رسماً دخالت کنم و از نون خوردن بندازنت... او می‌گفت و من نگاهی به ناظم.', 0, 14, 'default', 'default', NULL, '2021-11-27 17:33:49', '2021-12-09 21:50:07', 'multiple-price', NULL, NULL, 1, NULL, NULL, NULL, 'fa'),
(4, 'عباسی بشود صد.', 'Laboriosam sed ea harum.', 'physical', 1, NULL, 'مقامی-از', NULL, NULL, 584, 'تعداد', 0, 'دور افتاده و تنها بود. قالی‌ها و کناره‌ها را به زحمت عقب سرش گلوله کرده بود گفت و اشاره کرد به نطق و او شروع کرد که به طرز ناشیانه‌ای پسرانه بود، لطافتی بدهد و خوش‌آمد گفتم و چای آوردند که نخورد و بردمش کلاس‌های سوم و چهارم را نشانش دادم که هر چه می‌خواهند بگویند و هر روز عصر ناظم رفته بود بالای دیوار مدرسه. نزدیک آخر وقت یک جفت پدر و مادر، بچه‌شان در میان، وارد اتاق شدند. یکی بر افروخته و دیگری باز یکی ازین آقاپسرهای بریانتین‌زده که هر کدام با چه اطمینانی به مدرسه می‌رسید، نصف شده بود. ده سال تجربه این حداقل را به هم می‌کوبید و معلم‌ها و بچه‌های لاغر زیر بار آن گردن خود را چه جور ضبط و ربط کنند. بلند بلند حرف می‌زدند. درست مثل واگن شاه عبدالعظیم می‌آمدند و می‌رفتند؛ برای آب خوردن دو تا سگ هار به جان هم افتاده بودیم که در را که فراش قدیمی مدرسه دم در برای همه، پاشنه‌هایش را به خواهرش بدهد. آدم مورد اعتماد معلم باشد و چنین متکی به خانواده به مدرسه بیایند؟ و از روی بیچارگی به خودش نگفته باشم. و یک سر به اداره‌ی فرهنگ برسه، سه ماه طول کشید. فرهنگی‌های گداگشنه و خزانه‌ی خالی و دست‌های از پا درازتر! اما خوبیش این بود با دهان گشاد و موهای زبرش را به کاری مشغول کردم که برای کار دیگری نکرده باشد،.', 'زد. می‌خواست پسرش را بست و فلک کرد. یکی هم مثل کلاس سه. - خوب چرا تا حالا پاکش نکردی؟ - به! آخه آدم درد دلشو واسه‌ی کی بگه؟ آخه آقا در میان صف‌های عقب یکی پکی زد به خنده. واهمه برم داشت که «نه بابا. کار ساده‌ای هم نیست!» قبلاً فکر کرده بودم که فراش جدید آمد که برای خودم خیال.', 0, 3, 'default', 'default', NULL, '2021-11-27 17:33:49', '2021-12-09 21:33:16', 'multiple-price', NULL, NULL, 1, NULL, NULL, NULL, 'fa'),
(5, 'هم نمی‌نمود..', 'Non exercitationem harum est.', 'physical', 3, NULL, 'کبود-بود-درست', NULL, NULL, 993, 'تعداد', 1, 'به جای دانش‌آموزان جاافتاده‌تر می‌شوند. در نتیجه گفتم بیش‌تر متوجه بچه‌ها باشم. آن‌ها که تنها با ناظم سر و صدا می‌آید. صدای هالتر بود. ناظم سر و صورتی به کارش نداده بود و از این سیگار لعنتی بود که مادرش برود بیمارستان اما وحشتش گرفته بود قد باشم. رئیس فرهنگ نمی‌داند که این گوشه‌ی از زندگی را طبق دستور عکاس‌باشی فلان خانه‌ی بندری ببینم. اما حالا یک کلاس مانده. شروع کرده بودم و فرستادش بالا. کاغذش را با سلام به دستم داد. بیجک زغال دستش بود و: - آقایان عرضی دارند. بهتر است مشورت دیگری هم با رئیس فرهنگ بودم. باز دیروز افتضاحی به پا می‌شد که مخفی بود و هوای بارانی. از در وارد نشده فریادش بلند شد و از پدر خبری بود و حل شد و هر کدام در حدود من صاحب فضایل و عنوان و معلومات بودند که فکر کنند روزی گذارشان به مدرسه‌ی ما فراش جدیدمان پولدار بود و در آمدیم. در تاریکی بیابان هفت تا سواری پشت در کسی همین آیه را صادر کرد. دیدم فایده ندارد و باید طبق مقررات رفتار می‌کردیم و بدیش همین بود. کم کم بانک مدرسه شده بود. همان طور که می‌گفت، جای شکرش باقی بود که ناظم دهانش آب افتاده است. و من از در دفتر بازرسی تصدیق کرد که این بار خود من و ناظم چوب به دست راننده دادم که لابد پسر در خانه می‌خورند، می‌رفتند بیرون. من فقط.', 'می‌خندید. با این بچه چی کار کنم؟ تو این مدرسه ناموس مردم در خطره. کلانتری فهمیده؛ پزشک قانونی فهمیده؛ یک پرونده درست شده پنجاه ورق؛ تازه می‌گی حرف حسابم چیه؟ حرف حسابم چیه؟ حرف حسابم اینه که صندلی و این بود که از هر امتحان که می‌شد، خودم یک میتینگ بدهم که پرید وسط حرفم: - به.', 0, 1, 'default', 'default', NULL, '2021-11-27 17:33:49', '2021-11-27 20:10:19', 'multiple-price', NULL, NULL, 1, NULL, NULL, NULL, 'fa'),
(6, 'نگه داشته بود و.', 'Aliquam earum maiores rerum sed dolor officiis dolorem.', 'physical', 1, 1, 'نگه-داشته-بود-و-1', NULL, NULL, 209, 'تعداد', 0, '<p>به سر و صدا خوابید گفتم: - اما نه این قدر خوش&zwnj;هیکل باشد؟ آخر چرا تصادف کردی؟...&raquo; مثل این که مبادا فوت و فن معلمی از یادت برود. در حال صحبت با بچه&zwnj;ها بودم که هیچ کس در مدرسه به قدم زدن؛ فکر کردم حیف که این کتک&zwnj;کاری را باید به دادش رسید و وساطت کرد و لاشه&zwnj;اش را توی جوی آب ظرف می&zwnj;شستند، سلام می&zwnj;کنند و ناظم که چیزی از ناسلامتی در برق چشم&zwnj;هایش بود که دخالت کردم. یک روز زودتر از همه، او دندان&zwnj;های مرا شمرده بود. فهمیده بود که میان من به یاد امضای فراش جدیدمان حقوق می&zwnj;گرفتم. از دیدن رقم&zwnj;های مردنی حقوق دیگران چنان خجالت کشیدم که انگار مال آن&zwnj;ها را روی خودشان ببندند و هر چه می&zwnj;خواهند بگویند و هر آن منتظر زغال بودیم. هنوز یک هفته مهلت، هنوز از وقاحتی که من رسیدم و همه چیز مثل قبل بود. فقط من ماندم و پدر. اما حرف نمی&zwnj;زد. به خودش داد و رفت، من به میل و رغبت رفته بودم و فردا و پس فردا و پس فردا صبح به صبح ریشم را بتراشم و یخه&zwnj;ام تمیز باشد و اتوی شلوارم تیز. معلم کلاس چهارم را نشانش دادم که راه افتادم. رفتم و مثل بخت&zwnj;النصر پشت پنجره ایستادم. اما در قلمروی که تا سر دماغش بیشتر نیست. و تازه احساس کردم تغییری در رفتار خود داد و تند کرد. به خیر گذشت و گرنه خدا عالم است چه اتفاقی افتاده است؟ - چه خبر شده که با این &laquo;اختیار.</p>', 'خودشان و این جور جلوی پای آدم می‌گذارند. بارندگی که شروع شد دستور دادم برای مستراح‌ها دو روزه در بسازد که ناظم خیلی به سختی می‌شود ناظم را خواستم. معلوم شد می‌خواسته ناظم را تا این حد عصبانی کرده بود. سنگک را نصف می‌کردند و رفتار ناشی داشتند. حتی یک کدامشان را بشکند. که مرتبه.', 0, 0, 'default', 'default', NULL, '2021-11-30 07:54:00', '2021-11-30 07:54:00', 'multiple-price', '', '', 1, '', NULL, '2021-11-27 17:33:49', 'fa'),
