(5, 'دین لوس', 5, 'مزیت ریشه لاتین آن و بی معنی بودن نسبی لورم ایپسوم این است که متن توجه را به خود جلب نمی کند یا توجه بیننده را از طرح منحرف نمی کند.', '/uploads/ckeditor/index/05.jpg', '2022-02-05 15:32:40', '2022-02-05 15:32:40');
